import React from 'react';

const WindSwitch = ({ video }) => {

    return (
        <div className="ui row">


            <div className="three wide column">
                <input
                    type="radio"
                    checked="checked"
                />
                <label>On</label>
            </div>

            <div className="three wide column">
                <input
                    type="radio"
                    checked="unchecked"
                />
                <label>Off</label>
            </div>

        </div>
    );
};

export default WindSwitch;
